Got a friend asking me for help with their final C programming exams which they failed 8 times (yes, 8 🤷).

@justamoment Oh good lord 😳 Learning C is actually quite simple, but doing anything remotely useful and interesting in such a low-level language in IMO insane. It’s basically the equivalent (it actually is) Assembly. – That being said, I would recommend writing a few CLI tools, filters, processors, whatever. I wouldn’t attempt anything more complex/elaborate than this given that he/she/her/them/whatever are struggling with even basic compilation 😅 – Also ditch C, learn Go. There is no job out there (besides low-level embedded programming) that requires you to be proficient at C, even in the embedded field you can write Go and compile with the Tiny Go compiler which supports a growing number of micro processors and controllers 👌

